class TodoForm extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            inputValue: "kjkld"
        }

    }


    render(){
        return(
            <form>
                <input 
                type = "text" value={this.state.inputValue}/>
                <button type="submit">Submit</button>
            </form>
        )
        }
}

export default TodoForm
